function App() {

  return (
    <div className="App">
      <Navbar bg="light" expand="lg">
        <Navbar.Brand>
          React Simple Weather App
        </Navbar.Brand>
      </Navbar>

      <WeatherDisplay place={"Kiev"} zip={"703448"} />
    </div>
  );
}

export default App;
